	(3785, ' SINKS  LD116S-2', 'อ่างล้างจานหลุมเหลี่ยมมุมโค้ง 2 หลุม 1 ที่พักจานด้านซ้าย SMEG รุ่น LD116S-2', 'อ่างล้างจานหลุมเหลี่ยมมุมโค้ง 2 หลุม 1 ที่พักจานด้านซ้าย SMEG รุ่น LD116S-2', 'อ่างล้างจานหลุมเหลี่ยมมุมโค้ง 2 หลุม 1 ที่พักจานด้านซ้าย SMEG รุ่น LD116S-2', '', NULL, ' SINKS  LD116S-2', 'อ่างล้างจานหลุมเหลี่ยมมุมโค้ง 2 หลุม 1 ที่พักจานด้านซ้าย SMEG รุ่น LD116S-2', '<p>SMEG 2 BOWLS LEFT DRAINER ULTRA LOW PROFILE SQUARE-R SINK Mod.LD116S-2</p>\r\n', '<p>อ่างล้างจานหลุมเหลี่ยมมุมโค้ง 2 หลุม 1 ที่พักจานด้านซ้าย&nbsp;สเตนเลส สตีล AISI304.</p>\r\n\r\n<p>ขอบอ่างสูงจากท็อปเพียง 4 มิลลิเมตร.</p>\r\n\r\n<p>&nbsp;ขนาดหลุม : 34.0 x 40.0 ซม. มุมโค้ง R=15 ซม.&nbsp; &nbsp;</p>\r\n', '<p>Double bowls Square-R sink,single left hand drainer.<br />\r\nStainless steel AISI304. &nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&nbsp;<br />\r\n4 mm high on kitchen top.&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&nbsp;<br />\r\nBowl size : 34.0 x 40.0 cm. R=15 cm. 2 bowls.<br />\r\nBowl depth : 20 cm.&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&nbsp;<br />\r\nDrain 3.5 with overflow and P-TRAP.&nbsp;&nbsp; &nbsp;&nbsp;<br />\r\nDimension &nbsp; : W x D :116.8 x 50.8 cm.<br />\r\nBowl depth &nbsp;: 20 cm.&nbsp;&nbsp; &nbsp;&nbsp;<br />\r\nCutting size &nbsp;: W x D :114.0 x 48.0 cm.</p>\r\n', '<p>อ่างล้างจานหลุมเหลี่ยมมุมโค้ง 2 หลุม 1 ที่พักจานด้านซ้าย สเตนเลส สตีล AISI304.</p>\r\n\r\n<p>ขอบอ่างสูงจากท็อปเพียง 4 มิลลิเมตร.</p>\r\n\r\n<p>&nbsp;ขนาดหลุม : 34.0 x 40.0 ซม. มุมโค้ง R=15 ซม. &nbsp;&nbsp;</p>\r\n\r\n<p>2 หลุม หลุมลึก 20 ซม.</p>\r\n\r\n<p>สะดืออ่าง 3 1/2 นิ้ว พร้อมท่อน้ำล้นและท่อกันกลิ่น (P-TRAP).</p>\r\n\r\n<p>ขนาดอ่าง : กว้าง x ลึก : &nbsp;116.8 x 50.8 ซม.&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&nbsp;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;หลุมลึก 20 ซม.&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&nbsp;<br />\r\nขนาดเจาะเฟอร์นิเจอร์ : กว้าง x ลึก &nbsp;: &nbsp;114.0 x 48.0 ซม.&nbsp;&nbsp; &nbsp;&nbsp;</p>\r\n', '', '', 'อ่างล้างจาน', 'SINKS', NULL, 0, 0, 0, 663, 465, 1293, '', 2, 2, 2, 2, '0000-00-00', 2, NULL, '2019-05-27 02:17:56', NULL, 'Jirawat', 3785, 0, 0, '', 3),
	(3819, 'HOBS  PC73GNO Classic Aesthetic', 'เตาแก๊ส /เตาไฟฟ้า  PC73GNO Classic Aesthetic', 'เตาแก๊ส /เตาไฟฟ้า  PC73GNO Classic Aesthetic', 'เตาแก๊ส /เตาไฟฟ้า  PC73GNO Classic Aesthetic', '', NULL, 'HOBS  PC73GNO Classic Aesthetic', 'เตาแก๊ส /เตาไฟฟ้า  PC73GNO Classic Aesthetic', '<p>HOB, 70/75 CM, GAS, CLASSICA, BLACK, BLACK FINISHING</p>\r\n\r\n<p><img alt="" src="http://www.smeg.co.th/image/product/symbo_original_259.jpg" /></p>\r\n', '<p>เตาแก๊สสเมก รุ่นPC73GNO ฐานกระจกเซรามิกสีดำ ดีไซน์ Classic ขนาด 70 ซม.</p>\r\n\r\n<p><img alt="" src="http://www.smeg.co.th/image/product/symbo_original_259.jpg" /></p>\r\n', '<p>Ultra-low profile installation</p>\r\n\r\n<p>3 gas burners</p>\r\n\r\n<p>Left: 6.2 kW</p>\r\n\r\n<p>Rear right: 3.0 kW</p>\r\n\r\n<p>Front right: 1.8 kW</p>\r\n\r\n<p>Cast iron pan stand</p>\r\n\r\n<p>Safety valves</p>\r\n\r\n<p>Ceramic glass</p>\r\n\r\n<p>Straight edge</p>\r\n\r\n<p>Frontal controls</p>\r\n\r\n<p>Standard installation burners</p>\r\n\r\n<p>Brass burners</p>\r\n\r\n<p>Brass knobs</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Voltage (V): 220-240 V</p>\r\n\r\n<p>Frequency (Hz): 50/60 Hz<br />\r\n<br />\r\n<img src="https://eshare-smegpix.4flow.net/webimgsmeg/Tech%20Drawings%20(png)/WEB_PC73GNO.png.jpg" /></p>\r\n', '<p>ฐานกระจกเซรามิกที่เรียบ แกร่ง บางพิเศษ</p>\r\n\r\n<p>ปุ่มควบคุมด้านหน้า</p>\r\n\r\n<p>3 หัวเตาแก๊สทำจากทองเหลือง ประกอบด้วย</p>\r\n\r\n<p>ซ้าย : หัวเตาใหม่ให้ความร้อนสูงพิเศษ 6,200 วัตต์</p>\r\n\r\n<p>หน้าขวา : 1,800 วัตต์</p>\r\n\r\n<p>หลังขวา : 3,000 วัตต์</p>\r\n\r\n<p>ตะแกรงรองภาชนะชนิดเหล็กหล่อ แข็งแรง ทนทาน</p>\r\n\r\n<p>มีระบบ Safety Valves ตัดแก๊สอัตโนมัติ</p>\r\n\r\n<p>มีตะแกรงเหล็กหล่อรองกระทะก้นกลม</p>\r\n\r\n<p>ระบบแก๊ส LPG</p>\r\n\r\n<p>ใช้กับหัวปรับแรงดันแก๊สชนิดแรงดันต่ำ(37mbar) เท่านั้น</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>อุปกรณ์พิเศษ</p>\r\n\r\n<p>หัวปรับแรงดันแก๊สเม็กซ์รุ่น SPR 37S</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>แรงดันไฟฟ้า : 220-240 โวลต์</p>\r\n\r\n<p>ความถี่ 50/60 เฮิร์ตซ์<br />\r\n<br />\r\n<img src="https://eshare-smegpix.4flow.net/webimgsmeg/Tech%20Drawings%20(png)/WEB_PC73GNO.png.jpg" /></p>\r\n', '', '', 'เตาแก๊ส', 'Hobs', NULL, 0, 0, 0, 667, 465, 1293, '', 2, 2, 2, 2, '0000-00-00', 2, NULL, '2019-05-27 12:06:56', NULL, 'Jirawat', 3819, 0, 0, '', 3),
