	(3824, 'HOBS  SI5322B', 'เตาแก๊ส /เตาไฟฟ้า  SI5322B', 'เตาแก๊ส /เตาไฟฟ้า  SI5322B', 'เตาแก๊ส /เตาไฟฟ้า  SI5322B', '', NULL, 'HOBS  SI5322B', 'เตาแก๊ส /เตาไฟฟ้า  SI5322B', '<p>HOB, 30 CM, INDUCTION, BLACK</p>\r\n\r\n<p><img alt="" src="http://www.smeg.co.th/image/product/symbo_original_264.jpg" /></p>\r\n', '<p>เตาอินดักชั่นสเมกรุ่น SI5322B ขนาด 30ซม.</p>\r\n\r\n<p><img alt="" src="http://www.smeg.co.th/image/product/symbo_original_264.jpg" /></p>\r\n', '<p>Ultra-low profile installation</p>\r\n\r\n<p>2 induction cooking zones</p>\r\n\r\n<p>2 booster cooking zones</p>\r\n\r\n<p>Front centre: &Oslash; 160 mm, 2.3 kW</p>\r\n\r\n<p>Booster (P) 3.0 kW</p>\r\n\r\n<p>Rear centre: &Oslash; 210mm, 1.3 kW</p>\r\n\r\n<p>Booster (P) 1.4 kW</p>\r\n\r\n<p>9 power levels</p>\r\n\r\n<p>Automatic pan diameter adjustment</p>\r\n\r\n<p>Pan detection</p>\r\n\r\n<p>Automatic switch off when overheat</p>\r\n\r\n<p>Protection against accidental start up</p>\r\n\r\n<p>Ceramic glass</p>\r\n\r\n<p>Bevelled edge</p>\r\n\r\n<p>Frontal controls</p>\r\n\r\n<p>Controls lock/Child safety</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Voltage (V): 220-240 V</p>\r\n\r\n<p>Frequency (Hz): 50/60 Hz</p>\r\n\r\n<p>Current (A): 16 A</p>\r\n\r\n<p>Electrical connection rating (W):3.6 kW</p>\r\n', '<p>ฐานกระจกเซรามิก เจียรนัยแบบ Bevelled Edge</p>\r\n\r\n<p>แผงควบคุมด้านหน้าระบบสัมผัส</p>\r\n\r\n<p>2 หัวเตาอินดักชั่น</p>\r\n\r\n<p>ปรับระดับความร้อนได้&nbsp; 9 ระดับ</p>\r\n\r\n<p>หน้า : &Oslash; 160 มม.,1,300 วัตต์ ,กำลังไฟสูงสุด 1,400 วัตต์</p>\r\n\r\n<p>หลัง : &Oslash; 210 มม., 2,300 วัตต์ ,กำลังไฟสูงสุด 3,000 วัตต์</p>\r\n\r\n<p>มีสัญญาณเตือนเมื่อสิ้นสุดการปรุงอาหาร&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>มีระบบป้องกันไม่ให้เตาทำงานเองโดยไม่ตั้งใจ</p>\r\n\r\n<p>มีระบบตรวจจับภาชนะและตรวจจับเส้นผ่านศูนย์กลางภาชนะโดยอัตโนมัติ</p>\r\n\r\n<p>มีระบบหยุดการทำงานเมื่อมีความร้อนสูงผิดปกติ</p>\r\n\r\n<p>มีระบบป้องกันการเล่นหรือสัมผัสปุ่มคำสั่งโดยไม่ตั้งใจ</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>อุปกรณ์มาตรฐาน</p>\r\n\r\n<p>เกี