	(3835, 'HB30-1VCGR/MS', 'เตาแก๊สชนิดติดตั้งฝังบนเคาน์เตอร์ HB30-1VCGR/MS', 'เตาแก๊สชนิดติดตั้งฝังบนเคาน์เตอร์ HB30-1VCGR/MS', 'เตาแก๊สชนิดติดตั้งฝังบนเคาน์เตอร์ HB30-1VCGR/MS', '', NULL, 'HB30-1VCGR/MS', 'เตาแก๊สชนิดติดตั้งฝังบนเคาน์เตอร์ HB30-1VCGR/MS', '<h2>HB30-1VCGR/MS</h2>\r\n', '<p>เตาแก๊สชนิดติดตั้งฝังบนเคาน์เตอร์<br />\r\nขนาด: 288x 510 มม.<br />\r\nปรับระดับความร้อนได้สูงสุด 11 ระดับ<br />\r\nกำลังไฟรวม 1,500 วัตต์<br />\r\nระบบจุดติด: ไฟฟ้า</p>\r\n', '<p>Total power: 1.5 KW<br />\r\nVoltage: 220-240V:<br />\r\nFrequency: 50/60 Hz:<br />\r\nConnection cable: 3G x 2.5 Sq.mm. with 1000 mm. length<br />\r\nProduct dimension: 288 x 510 mm.<br />\r\nCut out dimension: 270 x 494 mm.<br />\r\nPacking dimension: 355 x 560 x 165 mm.<br />\r\nNet weight: 5 kg.<br />\r\nGross weight: 6 kg.<br />\r\nRecommend installation note:<br />\r\nBreaker: 20A<br />\r\nConnection wired: 4 Sq.mm.</p>\r\n', '<p>เตาย่างไฟฟ้าเซรามิค ขนาด 30 ซม.<br />\r\nพื้นผิวกระจกเซรามิค<br />\r\nปรับระดับความร้อนได้สูงสุด 11 ระดับ<br />\r\nระบบตัดความร้อนอัติโนมัติเมื่ออุณหภูมิตัวเครื่องสูงเกินกำหนด<br />\r\nไฟแสดงความร้อนคงเหลือบนหัวเตา<br />\r\nกำลังไฟสูงสุด: 1,500 วัตต์<br />\r\nผลิตจากประเทศอิตาลี</p>\r\n', '', '', 'เตาแก๊ส', 'Hobs', NULL, 0, 0, 0, 667, 511, 1293, '', 2, 2, 2, 2, '0000-00-00', 2, NULL, '2019-05-27 01:20:24', NULL, 'Jirawat', 3835, 0, 0, '', 3),
	(3836, 'HB30-1WK/BG', 'เตาแก๊สชนิดติดตั้งฝังบนเคาน์เตอร์ HB30-1WK/BG', 'เตาแก๊สชนิดติดตั้งฝังบนเคาน์เตอร์ HB30-1WK/BG', 'เตาแก๊สชนิดติดตั้งฝังบนเคาน์เตอร์ HB30-1WK/BG', '', NULL, 'HB30-1WK/BG', 'เตาแก๊สชนิดติดตั้งฝังบนเคาน์เตอร์ HB30-1WK/BG', '<h2>HB30-1WK/BG</h2>\r\n', '<p>เตาแก๊สชนิดติดตั้งฝังบนเคาน์เตอร์<br />\r\nขนาดสินค้า: 300x 510 มม.<br />\r\nกำลังไฟรวม 5,000 วัตต์<br />\r\nตะแกรงรองภาชนะชนิดเหล็กหล่อ<br />\r\nระบบจุดติด: ไฟฟ้า</p>\r\n', '<p>Gas type: LPG<br />\r\nIgnition type: Electric (A/C) Ignition<br />\r\nTotal power: 5 KW<br />\r\nVoltage: 220-240V<br />\r\nFrequency: 50/60 Hz<br />\r\nConnection cable: 3G x 1.5 Sq.mm with 1000 mm. length<br />\r\nProduct dimension: 300 x 510 mm.<br />\r\nCut out dimension: 280 x 490 mm.<br />\r\nPacking dimension: 365 x 575 x 165 mm.<br />\r\nNet weight: 7.9 kg.<br />\r\nGross weight: 8.9 kg.</p>\r\n', '<p>เตาแก๊สชนิดติดตั้งฝังบนเคาน์เตอร์ ขนาด 30 ซม.<br />\r\nทำความสะอาดง่ายและปลอดภัยด้วยพื้นผิวกระจกนิรภัยสีดำ<br />\r\nเพิ่มประสิทธิภาพการทำความร้อนด้วยระบบหัวฉีดแก๊ส 5 หัว สามารถติดตั้งได้ทั้งในตู้เฟอร์นิเจอร์ที่มีความทึบ และไม่ต้องปรับอากาศด้านล่าง<br />\r\nดีไซน์ทันสมัยด้วยแผงหน้ากากอลูมีเนียม<br />\r\nระบบจุดติดไฟฟ้าพร้อมสายไฟ<br />\r\nระบบตัดแก๊สอัติโนมัติทันทีเมื่อเปลวไฟดับ<br />\r\nตะแกรงรองภาชนะชนิดเหล็กหล่อ<br />\r\nกำลังไฟรวม: 5,000 วัตต์</p>\r\n', '', '', 'เตาแก๊ส', 'Hobs', NULL, 0, 0, 0, 667, 511, 1293, '', 2, 2, 2, 2, '0000-00-00', 2, NULL, '2019-05-27 01:20:32', NULL, 'Jirawat', 3836, 0, 0, '', 3),
