	(4753, 'Faucets', 'ก๊อกผสมอ่างล้างจานแบบสัมผัส 360 องศา KFCK8788', 'ก็อกน้ำ ,ก๊อกผสมอ่างอาบน้ำ, จำหน่ายก๊อกน้ำผนัง,ก๊อกน้ำอ่างล้างจาน,ก๊อกอ่างล้างหน้า', 'ก็อกน้ำ ,ก๊อกผสมอ่างอาบน้ำ, จำหน่ายก๊อกน้ำผนัง,ก๊อกน้ำอ่างล้างจาน,ก๊อกอ่างล้างหน้า', '', NULL, 'Faucets', 'ก๊อกผสมอ่างล้างจานแบบสัมผัส 360 องศา KFCK8788', '', '<p>ก๊อกผสมอ่างล้างจานแบบสัมผัส 360 องศา KFCK8788<br />\r\n&nbsp; &nbsp;- ก๊อกระบบสัมผัส สามารถใช้งานได้ 360 องศา<br />\r\n&nbsp; &nbsp;- ระบบสัมผัสอัจฉริยะ เปิด-ปิด ด้วยสัมผัสเดียว<br />\r\n&nbsp; &nbsp;- ปรับหมุนได้รอบทิศทาง 360 องศา<br />\r\n&nbsp; &nbsp;- สเป้าท์ หรือปากก๊อก ยืดระยะได้ เพิ่มการใช้งานทั่วพื้นที่<br />\r\n&nbsp; &nbsp;- สามารถต่อเครื่องกรองน้ำแบบ UPC, US NSF-372 และ NSF-61 แบบมาตรฐาน<br />\r\n&nbsp; &nbsp;- วาล์ว 2 ระบบ ใช้งานได้ทั้งแบบสัมผัส หรือ แบบเปิด-ปิดปกติที่ก้านปัด</p>\r\n\r\n<p>&nbsp; &nbsp;* ติดตั้งง่ายไม่ยุ่งยาก พร้อมเสริมการรั่วซึมด้วยซีลโอริง 3 ชั้น<br />\r\n&nbsp; &nbsp;* ใช้งานได้ด้วยถ่านอัลคาไลน์ AA เพียง 4 ก้อน</p>\r\n', '', '', '', '', 'ก็อกน้ำ ,ก๊อกผสมอ่างอาบน้ำ, จำหน่ายก๊อกน้ำผนัง,ก๊อกน้ำอ่างล้างจาน,ก๊อกอ่างล้างหน้า', 'Faucets', NULL, 0, 0, 0, 695, 447, 1293, '', 2, 2, 2, 2, '0000-00-00', 2, NULL, '2019-05-29 11:00:58', NULL, 'Jirawat', 4753, 0, 0, '', 3),
