้ผลิตภัณฑ์เสียหาย และผู้ใช้ได้รับบาดเจ็บได้<br />\r\n- ห้ามทิ้งเศษขยะหรือสิ่งของลงในอ่างล้างหน้า จะทำให้เกิดการอุดตันของระบบท่อน้ำทิ้งได้</span></p>\r\n\r\n<p><span style="font-size:16px">การบำรุงรักษา<br />\r\n- ใช้น้ำยาทำความสะอาดที่เหมาะสม กับประเภทของผลิตภัณฑ์ และหลังจากที่ทำความสะอาดเสร็จ ควรรีบล้างออกให้สะอาดโดยเร็วแล้วเช็ดให้แห้ง &nbsp;เพื่อไม่ให้เกิดรอยด่างที่อ่าง</span></p>\r\n\r\n<p><span style="font-size:16px">W610 x D460 x H180 mm.</span></p>\r\n', '', '', 'อ่างล้างหน้าชนิดฝังบนเคาน์เตอร์', 'COUNTERTOP BASIN MA118', NULL, 0, 0, 0, 514, 451, 1293, '', 1, 2, 2, 2, '0000-00-00', 2, NULL, '2019-05-04 09:29:33', NULL, 'bow', 5984, 0, 0, '', 3),
