 &nbsp; &nbsp;<br />\r\nการใช้งานและข้อควรระวัง &nbsp; &nbsp;<br />\r\n- ห้ามเหยียบโยน ปีน หรือใช้แรงกดอ่างล้างหน้า เพราะจะทำให้ผลิตภัณฑ์เสียหาย และผู้ใช้ได้รับบาดเจ็บได้<br />\r\n- ห้ามทิ้งเศษขยะหรือสิ่งของลงในอ่างล้างหน้า จะทำให้เกิดการอุดตันของระบบท่อน้ำทิ้งได้</span></p>\r\n\r\n<p><span style="font-size:16px">การบำรุงรักษา<br />\r\n- ใช้น้ำยาทำความสะอาดที่เหมาะสม กับประเภทของผลิตภัณฑ์ และหลังจากที่ทำความสะอาดเสร็จ ควรรีบล้างออกให้สะอาดโดยเร็วแล้วเช็ดให้แห้ง &nbsp;เพื่อไม่ให้เกิดรอยด่างที่อ่าง<br />\r\nW800 x D470 x H185 mm.</span></p>\r\n', '', '', 'อ่างล้างหน้าชนิดฝังบนเคาน์เตอร์', 'COUNTERTOP BASIN MAE05(R)', NULL, 0, 0, 0, 514, 451, 1293, '', 1, 2, 2, 2, '0000-00-00', 2, NULL, '2019-05-05 09:56:52', NULL, 'bow', 6100, 0, 0, '', 3),
