<p><span style="font-size:16px">New gas hob. it&rsquo;s design to winder than general. You can to cooking thai food in comfortable.<br />\r\nIt&rsquo;s new all design. And It&rsquo;s very cool.&nbsp;<br />\r\n4 burners.<br />\r\nFront left: Ultra-rapid burner : 4.2 kW.<br />\r\nRare left: 1.75 kW.<br />\r\nFront right: 1.0 kW.<br />\r\nRare right: 3.0 kW.<br />\r\nStainless steel base.<br />\r\nAutomatic Electronic ignition.<br />\r\nMade in ITALY.<br />\r\n&nbsp;</span></p>\r\n', '<p><br />\r\n<span style="font-size:16px">มิติใหม่ของเตาแก๊สขนาด &nbsp;62 ซม. ที่ออกแบบให้มีพื้นที่ใช้งานที่กว้างขวางกว่าปกติ สามารถปรุงอาหารแบบไทยๆ ได้อย่างสะดวกสบาย แม้แต่การผัดอาหารด้วยกระทะกันลม พร้อมกับการปรุงอาหารอื่นๆ ในเวลาเดียวกัน<br />\r\nออกแบบได้สวยทันสมัย พร้อมพื้นที่ใช้งานที่กว้างเป็นพิเศษ ทำให้ปรุงอาหารได้สะดวกสบายยิ่งขึ้น<br />\r\n4 หัวเตาแก๊ส ประกอบด้วย<br />\r\nหัวเตาไฟแรงเปลวไฟ 3 ชั้น กำลังไฟ 4,200 วัตต์ 1 หัว<br />\r\nหัวเตาแก๊สใหญ่ กำลังไฟ 3,000 วัตต์ 1 หัว<br />\r\nหัวเตาแก๊สกลาง กำลังไฟ 1,750 วัตต์ 1 หัว<br />\r\nหัวเตาแก๊สเล็ก กำลังไฟ 1,000 วัตต์ 1 หัว<br />\r\nฐานเตาทำจาก สเตนเลส สตีล<br />\r\nระบบจุดแก๊สอิเล็กทรอนิกส์อัตโนมัติ<br />\r\nผลิตในประเทศอิตาลี</span></p>\r\n', '', '', 'เตาแก๊สMEX รุ่น BOX6', 'MEX GAS HOB Mod. BOX6', NULL, 0, 0, 0, 667, 449, 1293, '', 2, 2, 2, 2, '0000-00-00', 2, NULL, '2019-05-27 01:46:52', NULL, 'Jirawat', 6284, 0, 0, '', 3),
