เทคนิค&nbsp;</strong><br />\r\nขนาดกว้างxลึกxสูง : 28.8 x 51.0 x 6.0 ซม.&nbsp;<br />\r\nขนาดเจาะเฟอร์นิเจอร์ : กว้างxลึก : 27.0 x 49.0 ซม.&nbsp;<br />\r\nอัตราการกินไฟสูงสุด : 3,500 วัตต์ 15.91 แอมป์.<br />\r\nขนาดสายไฟ (ตร.มม.) : 3x2.5 (THW).<br />\r\nต้องต่อสายดินและมีเบรคเกอร์ควบคุม.<br />\r\n<strong>คุณสมบัติ&nbsp;</strong><br />\r\n2 หัวเตา ประกอบด้วย&nbsp;<br />\r\n&nbsp;หน้า : ขนาด 151 มม. กำลังไฟ 1500 วัตต์.<br />\r\n&nbsp;หลัง : ขนาด 186 มม. กำลังไฟ 2000 วัตต์.</span><br />\r\n&nbsp;</p>\r\n', '<p><span style="font-size:16px">Digital touch control, 9 levels of power cooking<br />\r\n&quot;U&quot; Function for warming or simmering<br />\r\n&quot;A&quot; Function for Automatic boil control<br />\r\nIndividual timer for cooking each zone (1-99 min)<br />\r\nAutomatic pan recognition system<br />\r\nSafety lock (control lock)<br />\r\nSensor touch control<br />\r\n&nbsp;</span></p>\r\n', '<p><span style="font-size:16px">ระบบควบคุมแบบสัมผัส, ปรับระดับความร้อนได้ 9 ระดับ.<br />\r\nฟังก์ชัน &quot;U&quot; อุ่นอาหาร.<br />\r\nฟังก์ชัน &quot;A&quot; เร่งความร้อนให้สูงสุดและกลับสูงระดับที่ที่ตั้งไว้.<br />\r\nตั้งเวลาปรุงอาหาร 1-99 นาที แยกอิสระ 2 หัว.<br />\r\nระบบตรวจจับภาชนะ.<br />\r\nระบบล็อคการทำงาน ป้องกันอันตรายจากการใช้เตาโดยไม่ตั้งใจ.<br />\r\nระบบล็อคอัตโนมัติ ป้องกันกรณีทำน้ำหกลงบนเตา.</span></p>\r\n', '', '', 'เตาอินดักชั่น MEX รุ่น HIM332', 'MEX INDUCTION HOB MODEL HIM332', NULL, 0, 0, 0, 667, 449, 1293, '', 2, 2, 2, 2, '0000-00-00', 2, NULL, '2019-05-27 01:47:19', NULL, 'Jirawat', 6294, 0, 0, '', 3),
