/>\r\nอัตราการกินไฟสูงสุด : 6,500 วัตต์ 29.6 แอมป์.<br />\r\nขนาดสายไฟ (ตร.มม.) : 3 x 6 (THW).<br />\r\nต้องต่อสายดินและมีเบรกเกอร์ควบคุม.</span><br />\r\n&nbsp;</p>\r\n', '<p><span style="font-size:16px">ELECTRIC CERAMIC HOB 60 cm.<br />\r\nSCHOTT CERAN ceramic base.<br />\r\n4 zones EGO-hi light including<br />\r\n- Rear left : 1 Hi-light zone ? 200 mm./ 2.0 kW.<br />\r\n- Rear right : 1 Hi-light zone ? 165 mm./ 1.5 kW.<br />\r\n- Front left : 1 Hi-light zone ? 185 mm./ 1.8 kW.<br />\r\n- Front right : 1 Hi-light zone ? 150 mm./ 1.2 kW.<br />\r\n9 Power levels.<br />\r\nFunction &quot;U&quot; to warm.<br />\r\nFunction &quot;A&quot; to rapid hot.<br />\r\nVisual display when power on.<br />\r\nResidual heat indicators.<br />\r\nChild safety lock.</span></p>\r\n', '<p><span style="font-size:16px">เตาไฟฟ้าฐานเซรามิก ขนาด 60 ซม.<br />\r\nฐานกระจกเซรามิก SCHOTT CERAN คุณภาพสูง.<br />\r\n4 หัวเตา EGO ชนิดไฮไลท์ ประกอบด้วย<br />\r\n- หลังซ้าย : หัวเตาไฮไลท์ ขนาด 200 มม. กาลังไฟ 2,000 วัตต์.<br />\r\n- หลังขวา : หัวเตาไฮไลท์ ขนาด 165 มม. กาลังไฟ 1,500 วัตต์.<br />\r\n- หน้าซ้าย : หัวเตาไฮไลท์ ขนาด 185 มม. กาลังไฟ 1,800 วัตต์.<br />\r\n- หน้าขวา : หัวเตาไฮไลท์ ขนาด 150 มม. กาลังไฟ 1,200 วัตต์.<br />\r\nปรับระดับความร้อนได้ 9 ระดับ.<br />\r\nมีฟังค์ชั่น &quot;U&quot; อุ่นอาหาร.<br />\r\nมีฟังค์ชั่น &quot;A&quot; ที่เร่งความร้อนอย่างรวดเร็ว.<br />\r\nมีไฟสัญญาณการทางาน.<br />\r\nมีไฟสัญญาณเตือนความร้อนคงเหลือ.<br />\r\nมีระบบล็อคแผงควบคุมเพื่อความปลอดภัย.</span></p>\r\n', '', '', 'เตาไฟฟ้าฐานเซรามิก MEX รุ่น HV64.3', 'MEX ELECTRIC CERAMIC HOB Mod.HV64.3', NULL, 0, 0, 0, 667, 449, 1293, '', 2, 2, 2, 2, '0000-00-00', 2, NULL, '2019-05-27 01:24:01', NULL, 'Jirawat', 6308, 0, 0, '', 3),
