\r\n', '<p><span style="font-size:16px">Table top cooker,white body.<br />\r\nStainless steel top plate.<br />\r\nDetachable top plate,easy cleaning.<br />\r\n2 inner flame burners:<br />\r\n- Left : 2.9 kW.<br />\r\n- Right : 2.9 kW.<br />\r\nStainless steel tube and burner support.<br />\r\nSafety Valves will protect when gas leakage.<br />\r\nAutomatic electronic ignition:<br />\r\n- battery C 1.5 Volt.<br />\r\n&nbsp;</span></p>\r\n', '<p><span style="font-size:16px">เตาแก๊สตั้งโต๊ะรุ่นทรงสูง ตัวเครื่องสีขาว.<br />\r\nฝาท๊อปสเตนเลส สตีล.<br />\r\nฝาท๊อปถอดออกได้,ดูแลรักษาและทำความสะอาดง่าย.<br />\r\n2 หัวเตาแก๊ส เปลวไฟ Inner Flame ประกอบด้วย:<br />\r\n-หัวเตาซ้าย กำลังไฟ 2,900 วัตต์<br />\r\n-หัวเตาขวา กำลังไฟ 2,900 วัตต์<br />\r\nท่อส่งแก๊สและฐานจ่ายทาจากสเตนเลส สตีล.<br />\r\nมีระบบ Safety valves ตัดแก๊สเมื่อเปลวไฟดับ.<br />\r\nระบบจุดแก๊สอิเล็กทรอนิกส์อัตโนมัติโดยใช้ :<br />\r\n-ถ่านไฟฉายขนาด C 1.5 Volt</span></p>\r\n', '', '', 'เตาแก๊สตั้งโต๊ะทรงสูง 2 หัวแก๊ส MEX รุ่น PC712Si', 'MEX TABLE TOP COOKER MOD. PC712Si', NULL, 0, 0, 0, 667, 449, 1293, '', 2, 2, 2, 2, '0000-00-00', 2, NULL, '2019-05-27 01:49:32', NULL, 'Jirawat', 6372, 0, 0, '', 3),
