ส LPG</span></p>\r\n', '<p><span style="font-size:16px">Black tempered glass base<br />\r\nburners ? 100 mm.<br />\r\n- double ring burner 3.4 kW.<br />\r\nBlack body ,black coating stainless steel panel.<br />\r\nErgonomic knob design, easy control.<br />\r\nMatted finished metal pan support.<br />\r\nStainless steel water tray.<br />\r\nPiezo Automatic Ignition.</span></p>\r\n', '<p><span style="font-size:16px">ท็อปกระจกนิรภัยสีดำ tempered glass<br />\r\nหัวเตาแก๊สขนาด ? 100 มม.<br />\r\n- เปลวไฟ 2 ชั้น ไฟแรงสูงสุด 3,400 วัตต์.<br />\r\nตัวเครื่องสีดำ ,แผงด้านหน้าสเตนเลส สตีล รมดำ<br />\r\nปุ่มควบคุมดีไซน์สวย จับถนัดมือ<br />\r\nตะแกรงรองภาชนะทำจากเหล็กเคลือบสี<br />\r\nจานรองหัวเตา สเตนเลส สตีล เนื้อดี<br />\r\nจุดประกายไฟด้วยระบบลูกบิด</span></p>\r\n', '', '', 'เตาแก๊สตั้งโต๊ะ 1 หัวเตา MEX รุ่น PC717CB', 'FREE STAND GAS COOKER MOD. PC717CB', NULL, 0, 0, 0, 667, 449, 1293, '', 2, 2, 2, 2, '0000-00-00', 2, NULL, '2019-05-27 01:49:40', NULL, 'Jirawat', 6375, 0, 0, '', 3),
