้ำหนักสินค้า : 8.5 กก.<br />\r\nน้ำหนักสินค้ารวมบรรจุภัณฑ์ : 8.8 กก.<br />\r\nขนาดกล่องสินค้า : 44.0(ลึก) x 75.0(กว้าง) x 15.0(สูง) ซม.<br />\r\n<strong>ข้อมูลทางเทคนิค</strong><br />\r\nขนาด :กว้าง x ลึก x สูง : 72.0 x 37.5 x 8.0 ซม.<br />\r\nต้องใช้กับหัวปรับแรงดันชนิดความดันต่ำ (37 มิลลิบาร์) เท่านั้น.<br />\r\nใช้แก๊ส LPG.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '<p><span style="font-size:16px">Tempered glass top.<br />\r\n2 burners : 1 Infrared burner / 1 gas burner<br />\r\n&nbsp;- Left : double burner 3.0 kW.<br />\r\n&nbsp;- Right : ? 120 mm. double ring black coating brass burner 3.8 W.<br />\r\nStainless steel body,easy cleaning.<br />\r\nPiezo Automatic Ignition.<br />\r\n&nbsp;</span></p>\r\n', '<p><span style="font-size:16px">ฝาท๊อปกระจกคุณภาพสูง Tempered glass ดีไซน์สวย.<br />\r\n2 หัวเตา : 1 หัวเตาอินฟาเรด / 1 หัวเตาแก๊ส<br />\r\n&nbsp;ซ้าย หัวอินฟาเรดเปลวไฟ 2 ชั้น กำลังไฟ 3,000 วัตต์.<br />\r\n&nbsp;ขวา หัวเตาแก๊สทองเหลืองรมดำขนาดใหญ่พิเศษ ? 120 มม.กำลังไฟ 3,800 วัตต์<br />\r\nตัวเครื่องสเตนเลส สตีล แข็งแรง<br />\r\nจุดประกายไฟด้วยระบบลูกบิ</span></p>\r\n', '', '', 'เตาแก๊สตั้งโต๊ะ MEX รุ่น PC727CB', 'TABLE TOP GAS COOKER MOD. PC727CB', NULL, 0, 0, 0, 667, 449, 1293, '', 2, 2, 2, 2, '0000-00-00', 2, NULL, '2019-05-27 01:49:50', NULL, 'Jirawat', 6381, 0, 0, '', 3),
