ator (37 mbar) only.<br />\r\n&bull; LPG gas.&nbsp;&nbsp; &nbsp;</span></p>\r\n', '<p><span style="font-size:16px"><strong>เตาแก๊สหัวผสมชนิดตั้งโต๊ะ MEX รุ่น PC5892IGX</strong></span></p>\r\n\r\n<p><span style="font-size:16px"><strong>ข้อมูลผลิตภัณฑ์&nbsp;&nbsp;</strong> &nbsp; &nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&nbsp;<br />\r\n&bull; น้ำหนักสินค้า : 5.41 กก.&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&nbsp;<br />\r\n&bull; น้ำหนักสินค้ารวมบรรจุภัณฑ์ : 5.80 กก.&nbsp;&nbsp; &nbsp;&nbsp;<br />\r\n&bull; ขนาดกล่องสินค้า : 40.0 (ลึก) x 71.0 (กว้าง) x 13.0 (สูง) ซม.<br />\r\n<strong>ข้อมูลทางเทคนิค&nbsp;&nbsp; </strong>&nbsp; &nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&nbsp;<br />\r\n&bull; ขนาดสินค้า : กว้าง x ลึก x สูง : 69.0 x 36.0 x 12.0 ซม.<br />\r\n&bull; ต้องใช้กับหัวปรับแรงดันชนิดความดันต่ำ (37 มิลลิบาร์) เท่านั้น.<br />\r\n&bull; ใช้แก๊ส LPG&nbsp;&nbsp; &nbsp;</span></p>\r\n', '<p><span style="font-size:16px">&bull; Stainless steel top plate, easy cleaning<br />\r\n&bull; 2 burners: &nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&nbsp;<br />\r\n&nbsp; &nbsp; - Left : Infrared gas burner double burner 3.0 kW.&nbsp;<br />\r\n&nbsp; &nbsp; - Right : &nbsp;Black coating brass burner 3.8 kW.<br />\r\n&bull; Stainless steel body.&nbsp;&nbsp; &nbsp;&nbsp;<br />\r\n&bull; Piezo automatic ignition.&nbsp;&nbsp; &nbsp;&nbsp;<br />\r\n&bull; Small trivel for small pot.</span></p>\r\n', '<p><span style="font-size:16px">&bull; ฝาท๊อปสเตนเลส สตีล ทำความสะอาดง่าย&nbsp;&nbsp; &nbsp;&nbsp;<br />\r\n&bull; 2 หัวเตา : 1 หัวเตาอินฟราเรด / 1 หัวเตาแก๊ส&nbsp;&nbsp; &nbsp;&nbsp;<br />\r\n&nbsp; &nbsp; - ซ้าย : หัวเตาอินฟราเรด เปลวไฟ 2 ชั้น กำลังไฟ 3,000 วัตต์&nbsp;<br />\r\n&nbsp; &nbsp; - ขวา : หัวเตาแก๊สทองเหลืองรมดำ กำลังไฟ 3,800 วัตต์&nbsp;<br />\r\n&bull; ตัวเครื่องสเตนเลส สตีล แข็งแรง&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&nbsp;<br />\r\n&bull; จุดประกายไฟด้วยระบบลูกบิด&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&nbsp;<br />\r\n&bull; มีอุปกรณ์เสริมสำหรับวางภาชนะขนาดเล็ก</span></p>\r\n', '', '', 'เตาแก๊สหัวผสมชนิดตั้งโต๊ะ MEX รุ่น PC5892IGX', 'MEX TABLE TOP COMBINATION COOKER MOD. PC5892IGX', NULL, 0, 0, 0, 667, 449, 1293, '', 2, 2, 2, 2, '0000-00-00', 2, NULL, '2019-05-27 01:50:19', NULL, 'Jirawat', 6393, 0, 0, '', 3),
