nt-size:16px"><strong>ข้อมูลทางเทคนิค</strong><br />\r\nขนาด : กว้าง x ลึก x สูง : 69.0 x 36.0 x 12.0 ซม.<br />\r\nหัวเตาอินฟราเรดเส้นผ่าศูนย์กลาง 16 เซนติเมตร.<br />\r\nต้องใช้กับหัวปรับแรงดันชนิดความดันต่ำ (37 มิลลิบาร์) เท่านั้น.<br />\r\nใช้แก๊ส LPG.</span></p>\r\n', '<p><span style="font-size:16px">Infrared table top cooker.<br />\r\nStainless steel.<br />\r\ntainless steel top plate,easy cleaning.<br />\r\n2 Infrared gas burners:<br />\r\n- Reft : double burner : 3.0 kW.<br />\r\n- Right : double burner : 3.0 kW.<br />\r\nPiezo Automatic Igintion.<br />\r\nSmall trivet for small pot.</span><br />\r\n&nbsp;</p>\r\n', '<p><span style="font-size:16px">เตาแก๊สอินฟราเรดชนิดตั้งโต๊ะ.<br />\r\nสเตนเลส สตีล ทั้งตัว.<br />\r\nฝาท๊อปสเตนเลส สตีล ทาความสะอาดง่าย.<br />\r\n2 หัวเตาแก๊สอินฟราเรด ประกอบด้วย:<br />\r\n- หัวเตาซ้าย วงไฟ 2 ชั้นกาลังไฟ 3,000 วัตต์.<br />\r\n- หัวเตาขวา วงไฟ 2 ชั้นกาลังไฟ 3,000 วัตต์.<br />\r\nจุดประกายไฟด้วยระบบลูกบิด.<br />\r\nมีอุปกรณ์เสริมสาหรับวางภาชนะขนาดเล็ก.</span></p>\r\n', '', '', 'เตาแก๊สตั้งโต๊ะ 2 หัวแก๊สอินฟราเรด สเตนเลส สตีล MEX รุ่น PC6692IX.', 'MEX STAINLESS STEEL INFRARED TABLE TOP COOKER MOD.PC6692IX.', NULL, 0, 0, 0, 667, 449, 1293, '', 2, 2, 2, 2, '0000-00-00', 2, NULL, '2019-05-27 01:50:27', NULL, 'Jirawat', 6398, 0, 0, '', 3),
