big burners ? 160 mm.<br />\r\n- &nbsp;double ring burner 5.0 kW.<br />\r\nEasy control knob.<br />\r\nInner / Outer ring burner control knob separately.<br />\r\nMatted finished metal pan support.<br />\r\nPlate with pan support for heat protection convinience to use<br />\r\n2 pieces drawer and easy to clean<br />\r\nBack side plate<br />\r\n2 level trays<br />\r\nPiezo Automatic Ignition</span></p>\r\n', '<p><span style="font-size:16px">วัสดุทำจากสเตนเลส สตีล คุณภาพสูง<br />\r\n2 หัวเตาแก๊สขนาดใหญ่ ? 160 มม.<br />\r\n- &nbsp;เปลวไฟ 2 ชั้น ไฟแรงสูงสุด 5,000 วัตต์.<br />\r\nปุ่มควบคุมใช้งานง่าย จับถนัดมือ แยกการควบคุม<br />\r\nระหว่างเปลวไฟวงใน / วงนอก<br />\r\nตะแกรงรองภาชนะเหล็กหล่อแข็งแรงทนทาน<br />\r\nออกแบบแผงกั้นความร้อน ไม่ให้ความร้อนโดนภาชนะ หรือ เครืองปรุง ปลอดภัยขณะใช้งาน<br />\r\nออกแบบที่วางเครื่องปรุงให้ใช้งำนสะดวก<br />\r\nมีลิ้นชักรองรับคราบน้ำมัน หรือเศษอาหารขณะใช้งาน 2 ชิ้น ถอดทำความสะอาดง่าย<br />\r\nผนังกันความร้อนด้านหลังเตา<br />\r\nชั้นวางสเตนเลส สตีล อเนกประสงค์ 2 ชั้น<br />\r\nจุดประกายไฟด้วยระบบลูกบิด</span></p>\r\n', '', '', 'เตาแก๊สตั้งพื้น MEX รุ่น PSG561X', 'FREE STAND GAS COOKER MOD. PSG561X', NULL, 0, 0, 0, 667, 449, 1293, '', 2, 2, 2, 2, '0000-00-00', 2, NULL, '2019-05-27 01:51:05', NULL, 'Jirawat', 6424, 0, 0, '', 3),
