.0 x 48.0 ซม.<br />\r\nอัตราการกินไฟสูงสุด 6,000 วัตต์ 28 แอมป์<br />\r\nขนาดสายไฟ (ตร.มม) : 3 x 6 (THW)<br />\r\nต้องต่อสายดินและมีเบรกเกอร์ควบคุม</span></p>\r\n', '<p><span style="font-size:16px">ELECTRONIC HOB (White Enamel) from ITALY. &nbsp;<br />\r\n4 hot plates.<br />\r\nFront right: rapid plate 145 mm. / 1.5 kW.&nbsp;<br />\r\nRear right: 180 mm. / 1.5 kW.<br />\r\nFront left: rapid plate 180 mm. / 2.0 kW.<br />\r\nRear left: 145 mm. / 1.0 kW.<br />\r\nVisual display when power on.</span></p>\r\n', '<p><span style="font-size:16px">เตาไฟฟ้าฐานเหล็กเคลือบสีอินาเมลขาว ขนาด 60 ซม. จากอิตาลี<br />\r\n4 หัวเตาไฟฟ้าประกอบด้วย<br />\r\nหน้าขวา : ชนิดร้อนเร็วขนาด 145 มม. กำลังไฟ 1,500 วัตต์<br />\r\nหลังขวา : ขนาด 180 มม. กำลังไฟ 1,500 วัตต์<br />\r\nหน้าซ้าย : ชนิดร้อนเร็วขนาด 180 มม. กำลังไฟ 2,000 วัตต์<br />\r\nหลังซ้าย : ขนาด 145 มม. กำลังไฟ 1,000 วัตต์<br />\r\nมีไฟสัญญาณเมื่อเปิดการทำงาน</span></p>\r\n', '', '', 'MEX รุ่น SB155W (สีขาว)', 'MEX ELECTRIC HOB Mod. SB155W (WHITE)', NULL, 0, 0, 0, 667, 449, 1293, '', 2, 2, 2, 2, '0000-00-00', 2, NULL, '2019-05-27 01:56:07', NULL, 'Jirawat', 6427, 0, 0, '', 3),
