้อมูลทางเทคนิค</strong><br />\r\nขนาด : กว้าง x ลึก x สูง: 58.0 x 50.0 x 4.5 ซม.<br />\r\nขนาดเจาะเฟอร์นิเจอร์ : กว้าง x ลึก : 56.0 x 48.0 ซม.<br />\r\nอัตราการกินไฟสูงสุด: 1,500 วัตต์ 7 แอมป์<br />\r\nขนาดสายไฟ: (ตร.มม.): 3 x 2.5 (TWH)<br />\r\nต้องต่อสายดิน,ต้องใช้กับหัวปรับความดันชนิดความดันต่ำ (37 มิลลิบาร์) เท่านั้น</span></p>\r\n', '<p><span style="font-size:16px">GAS/ELECTRIC HOB (60 cm.)<br />\r\n3 burners + 1 hot plate.<br />\r\nFront left: Ultra rapid burner: 4.2 kW.<br />\r\nRare left: 1.75 kW.<br />\r\nFront right: 1.0 kW.<br />\r\nRare right: 145 mm.: 1.5 kW.<br />\r\nStainless steel base.<br />\r\nAutomatic electronic ignition.<br />\r\nCast iron pan stand.<br />\r\nMade in ITALY.&nbsp;</span></p>\r\n', '<p><span style="font-size:16px">เตาแก๊ส/ไฟฟ้า ชนิด 3 แก๊ส 1 ไฟฟ้า สเตนเลส สตีล ขนาด (60 ซม.)<br />\r\n3 หัวเตาแก๊สและ 1 หัวเตาไฟฟ้าประกอบด้วย<br />\r\nหัวเตาไฟแรงเปลวไฟ 3 ชั้น 4,200 วัตต์ 1 หัว<br />\r\nหัวเตาแก๊สขนาด 1,750 วัตต์ 1 หัว<br />\r\nหัวเตาแก๊สขนาด 1,000 วัตต์ 1 หัว<br />\r\nหัวเตาไฟฟ้าชนิดร้อนเร็ว &nbsp;145 มม.กำลังไฟ 1,500 วัตต์ &nbsp; &nbsp; &nbsp;<br />\r\nฐานทำจากสเตนเลส สตีล<br />\r\nมีระบบจุดแก๊สอิเล็กทรอนิกส์อัตโนมัติ ที่เปิดแก๊สและจุดมีประกายไฟได้ในปุ่มเดียวกัน<br />\r\nมีตะแกรงรองสำหรับวางกระทะก้นกลม<br />\r\nผลิตในประเทศอิตาลี&nbsp;<br />\r\n&nbsp;</span></p>\r\n', '', '', 'เตาแก๊ส/ไฟฟ้ า MEX รุ่น SB362X/4.2 (สเตนเลสสตีล)', 'MEX GAS/ELECTRIC HOB Mod. SB362X/4.2 (S/S)', NULL, 0, 0, 0, 667, 449, 1293, '', 2, 2, 2, 2, '0000-00-00', 2, NULL, '2019-05-27 01:51:13', NULL, 'Jirawat', 6438, 0, 0, '', 3),
