ng>ข้อมูลทางเทคนิค</strong><br />\r\nขนาด : กว้าง x ลึก x สูง: 58.0 x 51.0 x 4.0 ซม.<br />\r\nขนาดเจาะเฟอร์นิเจอร์ : กว้าง x ลึก : 56.0 x 49.0 ซม.<br />\r\nอัตราการกินไฟสูงสุด &nbsp;5,800 วัตต์ 26.36 แอมป์<br />\r\nขนาดสายไฟ (ตร.มม) : 3 x 6 (THW)<br />\r\nต้องต่อสายดินและมีเบรกเกอร์ควบคุม</span></p>\r\n', '<p><br />\r\n<span style="font-size:16px">ELECTRIC CERAMIC HOB (60 cm.)<br />\r\nBase CERAMIC. Grinding edges front and back.<br />\r\n4 zones including<br />\r\nFront left: 145 mm. / 1.2 kW.<br />\r\nRare left: 180 mm. / 1.7 kW.<br />\r\nFront right: 145 mm. / 1.2 kW.<br />\r\nRare right: 180 mm. / 1.7 kW.<br />\r\nDigital touch control with slider control.<br />\r\n9 power level ,function &ldquo;U&rdquo; to warm.<br />\r\nFunction &ldquo;A&rdquo; to rapid hot.<br />\r\nFunction &ldquo;PAUSE&rdquo;.<br />\r\nIndividual timers for each zone (1-99 minute.)<br />\r\nSafety Lock.<br />\r\nResidual heat indicators, time, level heat.<br />\r\nStandard accessory: SCRAPER.<br />\r\nMade in ITALY.</span></p>\r\n', '<p><span style="font-size:16px">เตาไฟฟ้าเซรามิก ขนาด (60 ซม.)<br />\r\nฐานเซรามิก เจียรนัยขอบด้านหน้าและด้านหลัง<br />\r\n4 หัวเตาไฟฟ้าไฮไลท์ ที่ร้อนเร็ว ประกอบด้วย<br />\r\nหน้าซ้าย : ขนาด 145 มม. กำลังไฟ 1,200 วัตต์<br />\r\nหลังซ้าย : ขนาด 180 มม. กำลังไฟ 1,700 วัตต์<br />\r\nหน้าขวา : ขนาด 145 มม. กำลังไฟ 1,200 วัตต์<br />\r\nหลังขวา : ขนาด 180 มม. กำลังไฟ 1,700 วัตต์<br />\r\nมีระบบควบคุมแบบ SLIDER CONTROL ที่ง่ายและสะดวกยิ่งขึ้นในการใช้งาน เพียงใช้นิ้วมือรูดไปมา ก็สามารถปรับระดับความร้อนได้ทันที อย่างรวดเร็ว<br />\r\nปรับระดับความร้อนได้ 9 ระดับพร้อมฟังก์ชั่น &ldquo;U&rdquo; ที่ให้ร้อนต่ำกว่าระดับ 1 เหมาะสำหรับการอุ่นอาหารให้รอนแต่ไม่เดือด<br />\r\nมีฟังก์ชั่น &ldquo;A&rdquo; ที่เร่งความร้อนอย่างรวดเร็ว<br />\r\nมีฟังก์ชั่น &ldquo;PAUSE&rdquo; ปิดหัวเตาชั่วคราว ในกรณีที่ต้องการปิดเตาชั่วคราวเพื่อไปทำอย่างอื่น<br />\r\nตั้งเวลาปรุงอาหารอิสระทั้ง 4 หัว ตั้งเวลาได้ 1-99 นาที<br />\r\nมีระบบ SAFETY LOCK ป้องกันการกดปุ่มเปลี่ยนคำสั่งโดยบังเอิญ<br />\r\nมีจอแสดงระดับความร้อน แสดงเวลาปรุงอาหาร และแสดงระดับความร้อนคงเหลือ<br />\r\nมี SCRAPER สำหรับทำความสะอาดฐาน เซรามิก<br />\r\nผลิตในประเทศอิตาลี</span></p>\r\n', '', '', 'เตาไฟฟ้าฐานเซรามิก MEX รุ่น V4SL (SLIDER CONTROL)', 'MEX ELECTRIC CERAMIC HOB Mod.V4SL SLIDER CONTROL', NULL, 0, 0, 0, 667, 449, 1293, '', 2, 2, 2, 2, '0000-00-00', 2, NULL, '2019-05-27 01:25:22', NULL, 'Jirawat', 6442, 0, 0, '', 3),
