/p>\r\n\r\n<p><span style="font-size:16px"><strong>Technical Data</strong><br />\r\nDimension: W x D x H: 28.8 x 51.0 x 5.0 cm.<br />\r\nCutting size: W x D: 27.0 x 49.0 cm.<br />\r\nNorminal power: 2,900 วัตต์ 14<br />\r\nSize of wire (mm2 ): 3 x 2.5 (THW)<br />\r\nThe Appliance must be grounded</span></p>\r\n', '<p><span style="font-size:16px"><strong>เตาไฟฟ้าฐานเซรามิกMEX รุ่นV30</strong></span></p>\r\n\r\n<p><span style="font-size:16px"><strong>ข้อมูลทางเทคนิค</strong><br />\r\nขนาด : กว้าง x ลึก x สูง: 28.8 x 51.0 x 5.0 ซม.<br />\r\nขนาดเจาะเฟอร์นิเจอร์ : กว้าง x ลึก : 27.0 x 49.0 ซม.<br />\r\nอัตราการกินไฟสูงสุด: 2,900 วัตต์ 14 แอมป์์<br />\r\nขนาดสายไฟ: (ตร.มม.): 3 x 2.5 (THW)<br />\r\nต้องต่อสายดินและมีเบรกเกอร์ควบคุม</span><br />\r\n&nbsp;</p>\r\n', '<p><span style="font-size:16px">Electric Ceramic Hob (30 cm.)<br />\r\nBase Ceramic. Grinding edges front and back<br />\r\n2 zones including<br />\r\nFront: 145 mm. / 1.2 kW.<br />\r\nRare: 180 mm. / 1.7 kW.<br />\r\n11 levels.<br />\r\nVisual display when power on.<br />\r\nResidual heat indicators.<br />\r\nSCRAPER (for cleaning ceramic base).<br />\r\nMade in ITALY.&nbsp;</span></p>\r\n', '<p><span style="font-size:16px">เตาไฟฟ้าเซรามิก ขนาด (30 ซม.)<br />\r\nฐานเซรามิก เจียระไนขอบทั้งด้านหน้าและหลัง<br />\r\n2 หัวเตาไฟฟ้าไฮไลท์ ที่ร้อนเร็ว ประกอบด้วย<br />\r\nหน้า : ขนาด 145 มม. กำลังไฟ 1,200 วัตต์<br />\r\nหลัง : ขนาด 180 มม. กำลังไฟ 1,700 วัตต์<br />\r\nปุ่มควบคุม ปรับระดับความร้อนได้ 11 ระดับ &nbsp; &nbsp; &nbsp;<br />\r\nมีสัญญาณไฟการทำงาน<br />\r\nมีจอแสดงสัญญาณเตือนความร้อนคงเหลือ<br />\r\nมี SCRAPER สำหรับทำความสะอาดฐาน เซรามิก<br />\r\nผลิตในประเทศอิตาลี&nbsp;</span></p>\r\n', '', '', 'เตาไฟฟ้าฐานเซรามิกMEX รุ่นV30', 'MEX ELECTRIC CERAMIC HOB Mod. V30', NULL, 0, 0, 0, 667, 449, 1293, '', 2, 2, 2, 2, '0000-00-00', 2, NULL, '2019-05-27 01:25:35', NULL, 'Jirawat', 6516, 0, 0, '', 3),
